INSERT INTO `baggi_app_content_page_translations` (`id`, `page_title`, `page_content`, `page_seo_title`, `page_meta_keywords`, `page_meta_descriptions`, `locale`, `content_page_id`, `created_at`, `updated_at`) VALUES
(3, 'About Us', '<p><em><strong>About Us.</strong></em></p>\r\n\r\n<p>&nbsp;</p>\r\n', 'About us', 'About Us', 'About Us', 'en', 1, '2016-11-21 16:34:15', '2019-03-15 15:52:25'),
(4, 'Passenger Terms and Conditions', '<p><a name=\"gtc_company\">General Terms and Conditions of Baggi Smart Phone Application for Passenger </a></p>\r\n\r\n<h1><strong>Introductory Provisions:</strong></h1>\r\n\r\n<p>These General Terms and Conditions for Passengers (&quot;Terms and Conditions&quot;) apply to the services which are offered by Baggi to the passengers (&quot;Baggi Services&quot;) via the Baggi app or the Baggi website <a href=\"http://www.baggi.com\">www.baggi.com</a></p>\r\n', 'Passenger Terms and Conditions', 'Passenger Terms and Conditions', 'Passenger Terms and Conditions', 'en', 2, '2016-11-21 16:34:15', '2019-05-14 12:16:55'),
(5, 'شروط الإنضمام', '•	ان تكون السيارة غير مظللة (في حالة وردت شكوى عن التظليل، يوقف الحساب)\r\n•	علامة التاكسي ضرورية جدا بمكان بارز\r\n•	استخرج تصديق للنقل الطارئ لضمان سلامتك الشخصية\r\n•	يشترط ان لا يتجاوز عمر المركبة 10 سنوات\r\n•	سوف تقوم النجوم بمعاينة السيارة قبل الموافقة عليها \r\n', 'شروط الإنضمام', 'شروط الإنضمام', 'شروط الإنضمام', 'ar', 2, '2016-11-21 16:34:15', '2017-10-07 12:55:10'),
(6, 'Required Documents', '<p>Required Documents</p>\r\n', 'Required Documents', 'Required Documents', 'Required Documents', 'en', 3, '2016-11-21 16:34:15', '2017-10-16 17:31:57'),
(8, 'المستندات المطلوبة', '•	صورة واضحة لشهادة البحث الخاصة بالسيارة\r\n•	صورة واضحة لرخصة القيادة خاصتك سارية المفعول\r\n•	صورة السيارة من الاربعة جوانب .. وعلامة الاجرة واضحة بها.. مع وضوح لوحة السيارة ( الأرقام والحروف) ..\r\n•	استخرج تصديق للنقل الطارئ لضمان سلامتك الشخصية\r\n•	صورة شخصية رسمية واضحة.. بخلفية بيضاء..\r\n', 'المستندات المطلوبة', 'المستندات المطلوبة', 'المستندات المطلوبة', 'ar', 3, '2016-11-21 16:34:15', '2017-10-07 12:55:10'),
(9, 'Driver Terms and Conditions', '<h1><strong>General Terms and Conditions of Baggi Smart Phone Application for Drivers</strong></h1>\r\n\r\n<p>The following sets forth the general terms and conditions (the &ldquo;Terms&rdquo;) between Biznisia Company. (The owner and operator of Baggi Application) and taxi drivers (&ldquo;Driver&rdquo; or &ldquo;Drivers&rdquo;). By using the Baggi Smartphone App, Drivers agree to be bound by these Terms.</p>\r\n\r\n<p>NOTE: Nothing herein changes the applicability of any local law or regulation pertaining to the transportation of Passengers in taxis. Drivers are bound by such laws and regulations, in particular, the laws and regulations pertaining to a minimum and maximum charges for such transportation.</p>\r\n\r\n<h2><strong>1. Services of&nbsp;Baggi&nbsp;</strong></h2>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; 1.1 The Driver shall register with Baggi, furnishing accurate information, before using the services of Baggi. Upon successful registration, the Driver shall be entitled to use the Baggi Smartphone App and the Baggi Services in accordance with these terms and conditions and applicable laws, rules, and regulations.</p>\r\n', 'Driver Terms and Conditions', 'Driver Terms and Conditions', 'Driver Terms and Conditions', 'en', 4, '2016-11-21 16:34:15', '2019-05-14 12:16:24'),
(10, 'sdad asd driver Arabic', '<p>sdad asd driver Arabic</p>\r\n', 'sdad asd driver Arabic', 'sdad asd driver Arabic\r\n', 'sdad asd driver Arabic\r\n', 'ar', 4, '2019-03-08 11:22:18', '2019-03-08 11:22:18');
