(19, 'Reply on assigned ticket', 'en', '<p>Dear {{$USER_NAME}},</p>\r\n\r\n<p>New repliy on your assigned ticket, please check below message:.</p>\r\n\r\n<p>Ticket Id- {{$TICKET_ID}}</p>\r\n\r\n<p>Message - {{$MESSAGE}}</p>\r\n\r\n<p>{{$SITE_TITLE}}</p>\r\n', 'reply-on-assign-ticket', '{{$USER_NAME}},\r\n{{$TICKET_ID}},\r\n{{$SITE_TITLE}},\r\n{{$MESSAGE}}', '0', '2016-11-18 08:30:00', '2019-04-19 05:01:14'),
