(67, 'تمت إعادة تعيين الركوب إلى سائق - لم يستجب السائق السابق', 'hi', '<p>عزيزي المسؤول,</p>\r\n\r\n<p>ركوب {{$ORDER_NUMBER}} تم رفضه من قبل السائق {{$OLD_STAR}} وقد تم إعادة تعيينها إلى {{$NEW_STAR}}. يرجى التحقق من وحدة التحكم على شبكة الإنترنت لمزيد من التفاصيل.</p>\r\n\r\n<p>مع تحياتي,</p>\r\n\r\n<p>{{$SITE_TITLE}}</p>\r\n\r\n<p>{{$SITE_EMAIL}}</p>\r\n', 'reassign-order-to-a-star-previous-assigned-expired-hi', '{{$ORDER_NUMBER}}\r\n{{$OLD_STAR}}\r\n\r\n{{$ORDER_ID}}\r\n{{$SITE_TITLE}}', '1', '2016-11-18 01:30:00', '2019-03-18 18:57:36'),
(68, 'A ride has been reassigned to a driver - previous driver did not respond', 'mr', '<p>Dear Admin,</p>\r\n\r\n<p>A Ride {{$ORDER_NUMBER}} has been rejected by driver {{$OLD_STAR}} and it has been reassigned to {{$NEW_STAR}}. Please check the web console for more details.</p>\r\n\r\n<p>Regards,</p>\r\n\r\n<p>{{$SITE_TITLE}}</p>\r\n\r\n<p>{{$SITE_EMAIL}}</p>\r\n', 'reassign-order-to-a-star-previous-assigned-expired-mr', '{{$ORDER_NUMBER}}\r\n{{$OLD_STAR}}\r\n\r\n{{$ORDER_ID}}\r\n{{$SITE_TITLE}}', '1', '2016-11-18 01:30:00', '2019-03-18 18:57:37'),
