(77, 'Registration completed successfully', 'en', '<table align=\"center\" border=\"0\" cellpadding=\"0\" cellspacing=\"0\" style=\"width:100% !important\">\r\n	<tbody>\r\n		<tr>\r\n			<td>\r\n			<table cellspacing=\"0\" style=\"width:100%\">\r\n				<tbody>\r\n					<tr>\r\n						<td style=\"vertical-align:top\">\r\n						<table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" style=\"width:100%\">\r\n						</table>\r\n						</td>\r\n					</tr>\r\n					<tr>\r\n						<td style=\"vertical-align:top\">\r\n						<table align=\"center\" border=\"0\" cellpadding=\"0\" cellspacing=\"0\" style=\"width:100%\">\r\n							<tbody>\r\n								<tr>\r\n									<td style=\"vertical-align:top\">\r\n									<table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" style=\"height:2px; width:100%\">\r\n										<tbody>\r\n											<tr>\r\n												<td style=\"background-color:#ed6f0e; vertical-align:top; width:100%\">&nbsp;</td>\r\n											</tr>\r\n										</tbody>\r\n									</table>\r\n\r\n									<table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" style=\"width:100%\">\r\n										<tbody>\r\n											<tr>\r\n												<td style=\"background-color:#ffffff\">\r\n												<p><img src=\"http://34.215.59.26/baggi_dev/public/media/backend/images/Logo-baggi-s.png\" style=\"height:75px; margin:17px 0\" /></p>\r\n												</td>\r\n											</tr>\r\n										\r\n											<tr>\r\n												<td style=\"text-align:center\">\r\n												<p>&nbsp;</p>\r\n\r\n												<h3>Welcome to Baggi Family</h3>\r\n\r\n												<p>&nbsp;</p>\r\n												</td>\r\n											</tr>\r\n											<tr>\r\n												<td style=\"background-color:#ffffff\">\r\n												\r\n\r\n												<h3>Thanks for signing up! We&#39;re excited to have you join us and start riding.</h3>\r\n\r\n												<p><span style=\"font-size:11pt\"><span style=\"line-height:107%\"><span style=\"font-family:Calibri,sans-serif\">Just request a pickup, and in minutes a car will be curbside and ready to take you wherever you want to go.</span></span></span></p>\r\n\r\n												<p>&nbsp;</p>\r\n\r\n												<h2 style=\"margin: 0in 0in 8pt;\">Tips to Get Started</h2>\r\n\r\n												<h3>Enter pickup location &amp; mark favorite</h3>\r\n\r\n												<p><span style=\"font-size:11pt\"><span style=\"line-height:107%\"><span style=\"font-family:Calibri,sans-serif\">Get a ride from your location and add the location to favorites for future use</span></span></span></p>\r\n\r\n												<h2><span style=\"font-size:11pt\"><span style=\"line-height:107%\"><span style=\"font-family:Calibri,sans-serif\">Book a ride at your convenience</span></span></span></h2>\r\n\r\n												<p><span style=\"font-size:11pt\"><span style=\"line-height:107%\"><span style=\"font-family:Calibri,sans-serif\">Enter your destination and select the type of taxi which you would like to use</span></span></span></p>\r\n\r\n												<h3 style=\"margin: 0in 0in 8pt;\"><span style=\"font-size:11pt\"><span style=\"line-height:107%\"><span style=\"font-family:Calibri,sans-serif\">Get fare estimation</span></span></span></h3>\r\n\r\n												<p style=\"margin:0in 0in 8pt\"><span style=\"font-size:11pt\"><span style=\"line-height:107%\"><span style=\"font-family:Calibri,sans-serif\">Get an approx. fare for your ride and confirm the ride</span></span></span></p>\r\n\r\n												<h2 style=\"margin: 0in 0in 8pt;\"><span style=\"font-size:11pt\"><span style=\"line-height:107%\"><span style=\"font-family:Calibri,sans-serif\">Track your ride</span></span></span></h2>\r\n\r\n												<p style=\"margin:0in 0in 8pt\"><span style=\"font-size:11pt\"><span style=\"line-height:107%\"><span style=\"font-family:Calibri,sans-serif\">Track the ride which is heading to you and will be notified when it arrives</span></span></span></p>\r\n\r\n												<h2 style=\"margin: 0in 0in 8pt;\"><span style=\"font-size:11pt\"><span style=\"line-height:107%\"><span style=\"font-family:Calibri,sans-serif\">Select the payment method</span></span></span></h2>\r\n\r\n												<p style=\"margin:0in 0in 8pt\"><span style=\"font-size:11pt\"><span style=\"line-height:107%\"><span style=\"font-family:Calibri,sans-serif\">After arriving at your destination, pay the way you want cash or Baggi wallet</span></span></span></p>\r\n\r\n												<h3 style=\"margin: 0in 0in 8pt;\"><span style=\"font-size:11pt\"><span style=\"line-height:107%\"><span style=\"font-family:Calibri,sans-serif\">Rate your ride</span></span></span></h3>\r\n\r\n												<h2 style=\"margin: 0in 0in 8pt;\"><span style=\"font-size:11pt\"><span style=\"line-height:107%\"><span style=\"font-family:Calibri,sans-serif\">You can rate the ride and write notes about your experience with Baggi</span></span></span></h2>\r\n\r\n												<p style=\"margin: 0in 0in 8pt;\"><span style=\"font-size:11pt\"><span style=\"line-height:107%\"><span style=\"font-family:Calibri,sans-serif\">No Need to Worry, All Drivers are screened and super well trained</span></span></span></p>\r\n\r\n												<p style=\"margin: 0in 0in 8pt;\"><span style=\"font-size:11pt\"><span style=\"line-height:107%\"><span style=\"font-family:Calibri,sans-serif\">Let&rsquo;s&nbsp; Go!</span></span></span></p>\r\n												</td>\r\n											</tr>\r\n											<tr>\r\n												<td style=\"background-color:#2e2e2e; text-align:center\">\r\n												<p style=\"padding-top:10px; color:#ffffff;\">Kuwait City (Sharq), Kuwait</p>\r\n\r\n												<p><a href=\"javascript:void(0);\" style=\"color:#ffffff;\">www.baggi.com </a></p>\r\n												</td>\r\n											</tr>\r\n											<tr>\r\n												<td style=\"background-color:#2e2e2e; text-align:center\">\r\n												<p><a href=\"\"><img src=\"http://34.215.59.26/baggi_dev/public/media/backend/images/facebook.png\" /></a> &nbsp; <a href=\"\"><img src=\"http://34.215.59.26/baggi_dev/public/media/backend/images/twitter.png\" /></a> &nbsp; <a href=\"\"><img src=\"http://34.215.59.