(86, 'order-releted-invoice', 'ar', '<p>العزيز {{$CUSTOMER_FIRST_NAME}} {{$CUSTOMER_LAST_NAME}},</p>\n\n\n<p><strong>تفاصيل الرحلة:</strong></p>\n\n<p>{{$PICKUP_AREA}}موقع المصدر:</p>\n\n<p>{{$DROP_AREA}}موقع وجهة:</p>\n\n\n<p><strong>تفاصيل الأجرة:</strong></p>\n\n<table style=\"width:100%\">\n    <thead>\n    <tr style=\"background-color: #4a4a4a;cursor: pointer;height: 60px;color: #63676b;padding-left: 20px;color: #fff;\">\n        <th>رسوم الأجرة</th>\n        <th>كمية</th>\n    </tr>\n    </thead>\n    <tbody>\n    <tr>\n        <td>الرسوم الثابتة</td>\n        <td>{{$FIXED_FEES}}</td>\n    </tr>\n    <tr>\n        <td>رسوم الركوب</td>\n        <td>{{$RIDE_STARTING_FEES}}</td>\n    </tr>\n    <tr>\n        <td>قبل ركوب رسوم القيادة</td>\n        <td>{{$PRE_RIDE_DRIVING_FEES}}</td>\n    </tr>\n    <tr>\n        <td>قبل ركوب رسوم الانتظار</td>\n        <td>{{$PRE_RIDE_WAITING_FEES}}</td>\n    </tr>\n    <tr>\n        <td>ركوب القيادة معدل</td>\n        <td>{{$RIDE_DRIVING_RATE}}</td>\n    </tr>\n    <tr>\n        <td>ركوب الخيل معدل الانتظار</td>\n        <td>{{$RIDE_WAITING_RATE}}</td>\n    </tr>\n    <tr>\n        <td>إجمالي مبلغ الرحلة</td>\n        <td>{{$TOTAL_TRIP_AMOUNT}}</td>\n    </tr>\n    </tbody>\n</table>\n\n<p>{{$SITE_TITLE}}</p>\n', 'order-related-invoice-ar', '{{$CUSTOMER_FIRST_NAME}},{{$CUSTOMER_LAST_NAME}},{{$SITE_TITLE}},{{$PICKUP_AREA}},{{$DROP_AREA}},{{$FIXED_FEES}},{{$RIDE_STARTING_FEES}},{{$PRE_RIDE_DRIVING_FEES}},{{$PRE_RIDE_WAITING_FEES}},{{$RIDE_DRIVING_RATE}},{{$RIDE_WAITING_RATE}},{{$TOTAL_TRIP_AMOUNT}}', '0', '2019-03-19 00:00:00', '2019-04-19 05:14:39');
